import React from 'react';

class RestaurantImage extends React.Component {
  render(){
    return(
      <div class="flex flex-col bg-green-400 justify-items-center">
        <div class="flex flex-row"><img alt="Fake Image" src="http://fake.image.com"/></div>
      </div>
    )
  }
}

export default RestaurantImage;
